import { Link } from "react-router-dom";
import { Nav, Navbar } from "react-bootstrap";
function Navbar1() {
  return (
    <Navbar collapseOnSelect expand="lg">
      <h3> Food Hub </h3>
      <Navbar.Toggle />
      <Navbar.Collapse>
        <Nav className="ml-auto d-line">
          <Nav.Item>
            {localStorage.getItem("user-auth-token") ? (
              <Nav.Link eventKey="1" as={Link} to="/logout">
                Logout
              </Nav.Link>
            ) : (
              <Nav.Link eventKey="2" as={Link} to="/login">
                Login
              </Nav.Link>
            )}
          </Nav.Item>
          {/* <Nav.Item>
            <Nav.Link eventKey="2" as={Link} to="/logout">
              Logout
            </Nav.Link>
          </Nav.Item> */}
          <Nav.Item>
            <Nav.Link eventKey="3" as={Link} to="/">
              Home
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="4" as={Link} to="/checkout">
              Checkout
            </Nav.Link>
          </Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
export default Navbar1;
